// Sidebar imports
import {
  UilDumbbell,
  UilUsersAlt,
  UilClipboardAlt,
  UilChart,
} from "@iconscout/react-unicons";

// Analytics Cards imports
import { UilUsdSquare, UilMoneyWithdrawal } from "@iconscout/react-unicons";

// Recent Card Imports
import img1 from "../imgs/img1.png";
import img2 from "../imgs/img2.png";
import img3 from "../imgs/img3.png";

// Sidebar Data
export const SidebarData = [
  {
    icon: UilClipboardAlt, // Replace with gym-related icon
    heading: "Workouts", // Update heading to match the category
  },
  {
    icon: UilDumbbell, // Replace with gym-related icon
    heading: "Equipment", // Update heading to match the category
  },
  {
    icon: UilUsersAlt, // Replace with gym-related icon
    heading: "Members", // Update heading to match the category
  },
  {
    icon: UilChart, // Replace with gym-related icon
    heading: "Analytics for GYM", // Update heading to match the category
  },
];

// Analytics Cards Data
export const cardsData = [
  {
    title: "Sales",
    color: {
      backGround: "C65BCF",
      boxShadow: "0px 10px 20px 0px #e0c6f5",
    },
    barValue: 70,
    value: "45,237",
    png: UilUsdSquare,
    series: [
      {
        name: "Sales",
        data: [31, 40, 28, 51, 42, 109, 100],
      },
    ],
  },
  {
    title: "Revenue",
    color: {
      backGround: "linear-gradient(180deg, #FF919D 0%, #FC929D 100%)",
      boxShadow: "0px 10px 20px 0px #FDC0C7",
    },
    barValue: 80,
    value: "44,340",
    png: UilMoneyWithdrawal,
    series: [
      {
        name: "Revenue",
        data: [10, 100, 50, 70, 80, 30, 40],
      },
    ],
  },
  {
    title: "Expenses",
    color: {
      backGround:
        "linear-gradient(rgb(248, 212, 154) -146.42%, rgb(255 202 113) -46.42%)",
      boxShadow: "0px 10px 20px 0px #F9D59B",
    },
    barValue: 60,
    value: "6,343",
    png: UilClipboardAlt,
    series: [
      {
        name: "Expenses",
        data: [10, 25, 15, 30, 12, 15, 20],
      },
    ],
  },
];

// Recent Update Card Data
export const UpdatesData = [
  {
    img: img1,
    name: "Rafael Fernandez",
    noti: "Kind and Simple guy.",
    time: "25 seconds ago",
  },
  {
    img: img2,
    name: "Kuma",
    noti: "Cute and Lovable.",
    time: "30 minutes ago",
  },
  {
    img: img3,
    name: "My one and Only",
